import React, { useState } from 'react';
import {
  Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper,
  FormControl, InputLabel, Select, MenuItem, Box, Typography, TextField
} from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import dayjs from 'dayjs';

// Sample data
const orders = [
  { id: 1, name: 'John Doe', address: '123 Main St', productName: 'Product A', quantity: 2, date: '2023-06-10' },
  { id: 2, name: 'Jane Smith', address: '456 Elm St', productName: 'Product B', quantity: 1, date: '2023-06-05' },
  { id: 3, name: 'Alice Johnson', address: '789 Maple St', productName: 'Product C', quantity: 4, date: '2023-05-22' },
  { id: 4, name: 'Bob Brown', address: '321 Oak St', productName: 'Product D', quantity: 3, date: '2023-04-15' },
];

const defaultTheme = createTheme();

function OrdersTable() {
  const [filter, setFilter] = useState({ day: '', month: '', year: '' });
  const [selectedDate, setSelectedDate] = useState(dayjs());

  const handleDateChange = (newDate) => {
    setSelectedDate(newDate);
    setFilter({
      ...filter,
      day: newDate.date(),
      month: newDate.month() + 1,
      year: newDate.year()
    });
  };

  const filteredOrders = orders.filter((order) => {
    const orderDate = dayjs(order.date);
    return (
      (!filter.day || orderDate.date() === filter.day) &&
      (!filter.month || orderDate.month() + 1 === filter.month) &&
      (!filter.year || orderDate.year() === filter.year)
    );
  });

  return (
    <ThemeProvider theme={defaultTheme}>
      <Box sx={{ p: 2 }}>
        <Typography variant="h4" gutterBottom>
          Orders
        </Typography>
        <LocalizationProvider dateAdapter={AdapterDayjs}>
          <DatePicker
            label="Filter by date"
            value={selectedDate}
            onChange={handleDateChange}
            renderInput={(params) => <TextField {...params} />}
          />
        </LocalizationProvider>
        <TableContainer component={Paper} sx={{ mt: 2 }}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Order ID</TableCell>
                <TableCell>Name</TableCell>
                <TableCell>Address</TableCell>
                <TableCell>Product Name</TableCell>
                <TableCell>Quantity</TableCell>
                <TableCell>Date</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {filteredOrders.map((order) => (
                <TableRow key={order.id}>
                  <TableCell>{order.id}</TableCell>
                  <TableCell>{order.name}</TableCell>
                  <TableCell>{order.address}</TableCell>
                  <TableCell>{order.productName}</TableCell>
                  <TableCell>{order.quantity}</TableCell>
                  <TableCell>{order.date}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </Box>
    </ThemeProvider>
  );
}

export default OrdersTable;
